    data: |
      SELECT col2 AS col2 FROM tab1 (FORMAT parquet) WHERE - + col2 * + col0 <= + - 83 * + col2 + - col1 + - col2 * + + ( + col0 ) * 11 + - col1 + - 97;
  - name: tab1

outputs:
  - name: q12519.out
    data: |
